y use to commute for work on a twice-daily commute. \n","######    - Members ride length is shorter than casuals but more frequent throughout the week. Casual use frequency increases over the weekend. \n","          \n","#         Suggestions \n","\n","######    - Offering a lower rate for longer rigdes could encourage both types to use more frequently and for longer times. \n","######    - Offering seasonal deasl for winter could help keep rates year round. \n","######    - Social media offers a chance to engage more and new members for less cost and overhead. Could use this as an incentive for new members with a deal. \n","          \n","          \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":559.792655,"end_time":"2023-02-26T17:51:32.028813","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-26T17:42:12.236158","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}